import React, { Component } from 'react';
import Navbar from './components/layout/Navbar';

import './App.css';

class App extends Component {
  render() {
    return (
      <div className='App'>
        <Navbar />
        <h1>Hello from reacts</h1>
      </div>
    );
  }
}

export default App;
